export async function render_list(
    ctx1: Context,
    commands: (string | number)[][],
    theme: string) {

    // 改变主题颜色
    await initTheme(ctx1, theme)

    let [x, y] = [50, 30]

    const a = await ctx1.canvas.render(width, height, async (ctx) => {

        ctx.drawImage(bg, 0, 0)
        ctx.fillStyle = theme
        ctx.font = '60px'
        ctx.textAlign = 'center'
        ctx.textBaseline = 'middle'
        ctx.fillStyle = "#000"
        ctx.fillText(
            '指令列表：',
            width / 2,
            y + 50,
        )
        ctx.textAlign = 'left'
        y += 150
        for (var i = 0; i < commands.length; i++) {
            if (i > 0 && i % themes.pluginsPeerRow1 == 0) {
                y += 90
                x = 50
            }
            // 渲染指令描述
            ctx.globalAlpha = 0.4
            ctx.drawImage(bg2, x - 20, y - 20)
            ctx.globalAlpha = 1
            ctx.font = '30px'
            if (isChinese(commands[i][0] as string)) {
                ctx.font = '25px'
            }
            ctx.textBaseline = 'middle'
            ctx.fillStyle = themes.textColor
            ctx.fillText(
                commands[i][0] as string,
                x,
                y,
            )
            // 渲染指令描述
            ctx.font = '18px'
            if (isChinese(commands[i][1] as string)) {
                ctx.font = '16px'
            }
            ctx.textBaseline = 'middle'
            ctx.fillStyle = themes.textColor
            ctx.fillText(
                commands[i][1] == '' ? 'n/a' : commands[i][1] as string,
                x,
                y + 30,
            )
            x += 250
        }
        y += 80

    })
    return a
}
export async function render_categroy(ctx1: Context, theme: string, pluginGrid: PluginGrid) {
    // 改变主题颜色
    await initTheme(ctx1, theme)
    let y = 10
    const a = await ctx1.canvas.render(width, height, async (ctx) => {
        ctx.drawImage(bg, 0, 0)
        for (var [key, value] of Object.entries(pluginGrid)) {
            if (!value.length) {
                continue
            }
            // 渲染分类名称
            ctx.fillStyle = theme
            ctx.font = '40px'
            ctx.textAlign = 'left'
            ctx.textBaseline = 'middle'
            ctx.fillStyle = "#000"
            ctx.fillText(
                category_map[key],
                10,
                y + 20,
            )
            y += 70
            let x2 = 30
            for (var i = 0; i < value.length; i++) {
                if (i > 0 && i % themes.pluginsPeerRow2 == 0) {
                    y += 70
                    x2 = 30
                }
                // 渲染指令
                ctx.globalAlpha = 0.5
                ctx.drawImage(bg2, x2 - 20, y - 20)
                ctx.globalAlpha = 1
                ctx.font = '30px'
                if (isChinese(value[i][0])) {
                    ctx.font = '25px'
                }
                ctx.textBaseline = 'middle'
                ctx.fillStyle = themes.textColor
                ctx.fillText(
                    value[i][0],
                    x2,
                    y,
                )
                // 渲染指令描述
                ctx.font = '20px'
                if (isChinese(value[i][1])) {
                    ctx.font = '18px'
                }
                ctx.textBaseline = 'middle'
                ctx.fillStyle = themes.textColor
                ctx.fillText(
                    value[i][1] == '' ? 'n/a' : value[i][1],
                    x2,
                    y + 30,
                )
                x2 += 185
            }
            y += 80
        }
    })
    return a
}
