/**
 * 判断字符串是否是中文
 * @param s 
 * @returns 
 */
function isChinese(s: string): boolean {
    return /[\u4e00-\u9fa5]/.test(s);
}

function calculateColorBrightness(r: number, g: number, b: number) {
    // 计算亮度
    const brightness = (r * 299 + g * 587 + b * 114) / 1000;
    return brightness;
}

// 解析 rgba 字符串
function parseColor(color: string) {
    color = color.slice(5, -1)
    return color.split(', ').map((v) => { return parseInt(v) })
}

/**
 * 从文件中读取图片为数组， 主要用来生成上面的拿一大坨数组
 * @param imagePath 图片路径
 * @returns 
 */
async function readImageAsArray(): Promise<number[][][]> {
    const imageStream = createReadStream(resolve(__dirname, './round.png'));
    const png = imageStream.pipe(new PNG());
    await new Promise((resolve, reject) => {
        png.on('parsed', resolve).on('error', reject);
    });
    const width = png.width;
    const height = png.height;
    const pixels = new Array(height);

    for (let y = 0; y < height; y++) {
        pixels[y] = new Array(width);
        for (let x = 0; x < width; x++) {
            const idx = (width * y + x) << 2;
            const r = png.data[idx];
            const g = png.data[idx + 1];
            const b = png.data[idx + 2];
            const a = png.data[idx + 3];
            pixels[y][x] = [r, g, b, a];
        }
    }
    return pixels;
}
/**
 * 将图片数组转为Arraybuffer
 * @param pixels 
 * @param width 
 * @param height 
 * @returns 
 */
function writeArrayToImage(pixels: number[][][], width: number = 170, height: number = 60) {
    // 创建一个新的PNG对象
    const png = new PNG({ width, height });
    // 将像素数据写入PNG对象
    for (let y = 0; y < height; y++) {
        for (let x = 0; x < width; x++) {
            // 获取像素索引
            const idx = (width * y + x) << 2;
            // 获取像素的RGBA值
            const [r, g, b, a] = pixels[y][x];
            // 将像素数据写入PNG对象
            png.data[idx] = r;
            png.data[idx + 1] = g;
            png.data[idx + 2] = b;
            png.data[idx + 3] = a;
        }
    }
    // 创建一个 Uint8Array 来保存 PNG 数据
    const pngBuffer = new Uint8Array(PNG.sync.write(png));

    // 转换 Uint8Array 到 ArrayBuffer
    const arrayBuffer = pngBuffer.buffer;

    return arrayBuffer;
}

/**
 * 在图片上添加数字
 * @param num 要添加的数字
 * @returns 
 */
async function chageArr(themes: Themes, color3: string) {
    const color2 = parseColor(color3)

    let { pixels, color } = themes
    for (let i = 0; i < pixels.length; i++) {
        for (let j = 0; j < pixels[i].length; j++) {
            if (pixels[i][j][0] == color[0] && pixels[i][j][1] == color[1] && pixels[i][j][2] == color[2] && pixels[i][j][3] == color[3]) {
                pixels[i][j] = color2
            }
            else {
                pixels[i][j] = [0, 0, 0, 0]
            }
        }
        themes.colorString = color3
        themes.color = color2
        themes.pixels = pixels
        themes.imgBuffer = writeArrayToImage(pixels)
        themes.textColor = calculateColorBrightness(color2[0], color2[1], color2[2]) < 126 ? "#FFFFFF" : "#000000"
    }
}
/**
 * 加载主题
 * @param ctx 
 * @param theme 
 */
async function initTheme(ctx: Context, theme: string) {
    if (theme !== themes.colorString) {
        await chageArr(themes, theme)
    }
    const imgUrl = ctx.config.background

    // 如果存在本地的图片链接则不重复加载
    if (!bg2) {
        bg2 = await ctx.canvas.loadImage(themes.imgBuffer);
        bg = await ctx.canvas.loadImage(imgUrl.replace('file:///', ''));
        width = bg["width"];
        height = bg["height"];
        themes.pluginsPeerRow1 = Math.floor(width / 185)
        themes.pluginsPeerRow1 = Math.floor(width / 250)

    } else {
        if (!imgUrl.startsWith('file:///') && imgUrl !== bgImg) {
            bg = await ctx.canvas.loadImage(imgUrl)
            width = bg["width"];
            height = bg["height"];
            themes.pluginsPeerRow2 = Math.floor(width / 185)
            themes.pluginsPeerRow1 = Math.floor(width / 250)

        }
    }
}
